import styled from 'styled-components'

export const OptionImage = styled.img`
  width: 170px;
  height: 170px;
`
export const OptionListItem = styled.li`
  list-style-type: none;
  display: flex;
`
export const GameOptionButton = styled.button`
  outline: none;
  cursor: pointer;
  background-color: transparent;
  border: none;
`
